webpackJsonp([0xb7ffe235adf7800],{"./node_modules/json-loader/index.js!./.cache/json/html-elements-input-tag.json":function(n,t){n.exports={data:{markdownRemark:{html:'<h2>Input Tag</h2>\n<p>The <code>&#x3C;input></code> tag creates interactive controls on web-based forms to accept data from the user. An input field can vary in many ways, depending on the type attribute.</p>\n<h3>The most common types used</h3>\n<p>text: A single-line text field.</p>\n<p>button: A button with no default behavior.</p>\n<p>submit: A button that submits the form.</p>\n<p>checkbox: A check box allowing values to be selected/deselected.</p>\n<p>date:  For entering a date (year, month, and day).</p>\n<p>email: For editing an e-mail address.</p>\n<p>file: Lets the user select a file. </p>\n<p>hidden: Not displayed but its value is submitted to the server.</p>\n<p>number: For entering a number.</p>\n<p>password: A single-line text field whose value is obscured.</p>\n<p>radio: A radio button, allowing a single value to be selected out of multiple choices.</p>\n<p>range: A control for entering a number.</p>\n<p>url: For entering a URL.</p>\n<h3>Example</h3>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>text<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>input</span> <span class="token attr-name">type</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>button<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<p><a href="https://www.w3schools.com/tags/tag_input.asp">https://www.w3schools.com/tags/tag_input.asp</a></p>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input">https://developer.mozilla.org/en-US/docs/Web/HTML/Element/input</a></p>',fields:{slug:"/html/elements/input-tag/"},frontmatter:{title:"Input Tag"}}},pathContext:{slug:"/html/elements/input-tag/"}}}});
